import { SkillBars } from "react-skills";

const skillsData = [
  {
    name: "ReactJS",
    level: 100,
    color: "light-blue",
  },
  {
    name: "SomeOtherTech",
    level: 85,
    color: "red",
  },
];

// ...
function Skills() {
  return <SkillBars skills={skillsData} />;
}

export default Skills;
